import React, { Component } from 'react'
import { withRouter } from './withRouter'; // Import the custom HOC
import { Form } from 'react-advanced-form'
import Cropper from 'react-easy-crop';
import axios from 'axios';
import ImageScannerIcon from '../images/ScannerIcon.png';
class Scanner extends Component {


  constructor(props) {
    super(props);
    this.state = {
      UrlApiScanner: "http://localhost:11234/api/ScanApi/ScannerPrint",
      imageSrc: 'data:image/jpeg;base64,' + "",
      crop: { x: 20, y: 20 },
      zoom: 1,
      rotationValue: 0,
      AspectsValue: 5 / 4,
      croppedAreaPixels: null,
      CropingCoplete: false,
      IsCaptureImage: false,
      IsLoading: false
    };

  }

  btnScan() {
    this.setState({
      IsLoading: true, IsCaptureImage: false
    }, () => {
      axios.get(this.state.UrlApiScanner)
        .then(response => {
          this.setState({
            IsLoading: false
          }, () => {
            if (response.data.IsError) {
              //Fiald Response
              this.props.ResponseMessageValue.setValue(response.data.ErrorMessage);

              if (this.props.onClickAlertMessage && this.props.onClickAlertMessage.canExecute) {

                this.props.onClickAlertMessage.execute();
              }

            } else {

              //Sucess Code
              if (response.data.Data) {
                this.setState({
                  IsCaptureImage: true,
                  imageSrc: "data:image/bmp;base64," + response.data.Data
                })
              }
            }
          })



        }).catch(error => {
          this.setState({
            IsLoading: false
          }, () => {
            if (window.confirm("قد يكون الجهاز غير متوفر او الخدمة متوقفة أو أنه لم يتم تثبيتها . هل تود تحميل تعريف الإصدار الأحدث من الخدمة؟")) {
              window.open("http://10.100.60.17:8080/EvisaServices/ScannerPolaris_WinSetup.msi", "_base");
            }
          })
        }
        )
    })
  }

  onCropChange = (crop) => {
    this.setState({ crop });
  };

  onZoomChange = (zoom) => {
    this.setState({ zoom, CropingCoplete: true });
  };



    FlipIMageChnage = async() => {

    if (this.state.rotationValue == "0") {
      this.setState({ rotationValue: this.state.rotationValue + 90, AspectsValue: 4 / 5 });
    }
    else if (this.state.rotationValue == "180") {
      this.setState({ rotationValue: this.state.rotationValue + 90, AspectsValue: 4 / 5 });
    } else {
      this.setState({ rotationValue: this.state.rotationValue + 90, AspectsValue: 5 / 4 });
    }

    if (this.state.rotationValue == "360") {
      this.setState({ rotationValue: 90, AspectsValue: 4 / 5 });
    }
  
      const { imageSrc } = this.state;
      const image =  await this.loadImage(imageSrc); 
      debugger;
      this.setState({
        imageSrc: image, CropingCoplete: false
      });
    
  }

  onCropComplete = (_, croppedAreaPixels) => {

    this.setState({ croppedAreaPixels });
  };

  cropImage = async () => {
    const { CropingCoplete } = this.state;
    ;
    if (CropingCoplete) {
      ;
      const { imageSrc, croppedAreaPixels } = this.state;
      const image = await this.loadImage(imageSrc);
      const canvas = document.createElement('canvas');
      const ctx = canvas.getContext('2d');

      canvas.width = croppedAreaPixels.width;
      canvas.height = croppedAreaPixels.height;

      ctx.drawImage(
        image,
        croppedAreaPixels.x,
        croppedAreaPixels.y,
        croppedAreaPixels.width,
        croppedAreaPixels.height,
        0,
        0,
        croppedAreaPixels.width,
        croppedAreaPixels.height
      );
      const croppedImage = canvas.toDataURL('image/jpeg');
      this.props.navigate('/', { state: { message: croppedImage } });
      this.setState({
        imageSrc: croppedImage, CropingCoplete: false
      });

    } else {
      alert('يرجى إقتصاص الصورة اولا');
    }

  };

  // تحميل الصورة من Base64
  loadImage = (src) =>
    new Promise((resolve, reject) => {
      const img = new Image();
      img.src = src;
      img.onload = () => resolve(img);
      img.onerror = (err) => reject(err);
    });


  handleButtonClick = () => {
    // Navigate to another page, passing data as state
    this.props.navigate('/', { state: { message: this.state.imageSrc } });
  };

  ClosePage() {
    this.setState({
      imageSrc: '', // تخزين الصورة كـ Base64
      crop: { x: 20, y: 20 },
      zoom: 1,
      croppedAreaPixels: null,
      CropingCoplete: false,
      IsCaptureImage: false,
      IsLoading: false
    }, () => {
      this.props.navigate('/', { state: { message: this.state.imageSrc } });
    })
  }


  btnDeleteAllImages() {
    this.setState({
      imageSrc: '',
      IsCaptureImage: false
    })

  }

    
  render() {
    const { imageSrc, crop, zoom, rotationValue, AspectsValue } = this.state;
    return (
      <Form>
        <div
          className="container"
          style={{ direction: 'ltr', marginTop: '20px', textAlign: 'center' }}
        >
          <div
            className="row d-flex align-items-center justify-content-center"
            style={{ display: 'flex', gap: '90px', justifyContent: 'center', marginTop: '5%' }}
          >
            {/* أداة الاقتصاص */}
            <div style={{ flex: '1', maxWidth: "450px", border: '1px solid black', borderRadius: '12px' }}>
              {imageSrc && (
                <div style={{ position: 'relative', width: '106%', height: '544px' }}>

                  <Cropper
                    image={imageSrc}
                    crop={crop}
                    zoom={zoom}
                    aspect={AspectsValue} // نسبة الأبعاد لجواز السفر
                    onCropChange={this.onCropChange}
                    onZoomChange={this.onZoomChange}
                    onCropComplete={this.onCropComplete}

                    zoomSpeed={0.05}
                    rotation={rotationValue}
                    onRotationChange={this.OnChnageRotation}
                  />
                </div>
              )}
              {!imageSrc && (
                <div style={{ position: 'relative', width: '106%', height: '544px' }}>
                  <img src={ImageScannerIcon} style={{ width: '93%', height: '542px', borderRadius: '12px', left: '-3%', position: 'relative' }} />
                </div>
              )}
            </div>
            {/* أزرار التحكم */}
            <div
              style={{
                flex: '1',
                display: 'flex',
                flexDirection: 'column',
                gap: '15px',
                maxWidth: "300px",
                marginTop: '8%',
              }}
            >
              <input
                id="btnScan"
                type="button"
                value="مسح ضوئي"
                className='HoverButton'
                onClick={() => this.btnScan()}
                style={{
                  width: "80%", height: "60px", color: "white",
                  backgroundColor: "#024444", fontSize: "20px", borderRadius: "12px", cursor: 'pointer'
                }}
              />
              <input
                type="button"
                id="btnSaveBase64"
                value="حفظ الصورة"
                onClick={this.cropImage}
                style={{
                  width: "80%", height: "60px", color: "white",
                  backgroundColor: "#024444", fontSize: "20px", borderRadius: "12px", cursor: 'pointer'
                }}
              />
              <input
                type="button"
                id="btnDeleteAllImages"
                value="حذف الصورة"
                onClick={() => this.btnDeleteAllImages()}
                style={{
                  width: "80%", height: "60px", color: "white",
                  backgroundColor: "#024444", fontSize: "20px", borderRadius: "12px", cursor: 'pointer'
                }}
              />
              <input
                type="button"
                id="btnClose"
                value="إغــلاق"
                onClick={() => this.ClosePage()}
                style={{
                  width: "80%", height: "60px", color: "white",
                  backgroundColor: "#024444", fontSize: "20px", borderRadius: "12px", cursor: 'pointer'
                }}
              />
              <input
                type="button"
                id="btnClose"
                value="تدوير"
                onClick={() => this.FlipIMageChnage()}
                style={{
                  width: "80%", height: "60px", color: "white",
                  backgroundColor: "#024444", fontSize: "20px", borderRadius: "12px", cursor: 'pointer'
                }}
              />
            </div>
          </div>
        </div>
      </Form>

    )
  }
}

export default withRouter(Scanner);